import React from 'react';
import { Link } from 'react-router-dom';

const DashboardPage = () => {
  // You can add the contents for the dashboard page here
  return (
    <div>
      <header>
        <div className="title-container">
          <h1>SHOE COLLECTION</h1>
        </div>
        <nav className="nav-links-container">
          <Link to="/add-shoe" className="add-shoe-button">
            Add Shoe
          </Link>
          <Link to="/LoginPage" id="logout-button">
            Log Out
          </Link>
        </nav>
      </header>
      <main className="login-main">{/* Your dashboard content */}</main>
      <footer>
        <p>Copyright Â© 2023 Shoe Collection</p>
      </footer>
    </div>
  );
};

export default DashboardPage;
